nte un po  la mancanza del led di notifica, ma a pensarci bene, il tutto si traduce in meno stress. Si evita cos√¨ di avere l ansia di guardare ogni minuto verso il telefono per vedere se ci sono notifiche.A mio avviso il prezzo non √® alto. 500 euro come prezzo di lancio sono giusti per quello che offre il telefono.La qualit√† si paga!',4,'2018-01-26',4),
